b\u0438 140 \u0447\u0435\u043b\u043e\u0432\u0435\u043a .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1874_%D0%B3%D0%BE%D0%B4\" title=\"1874 \u0433\u043e\u0434\">1874<\/a>&#160;\u2014 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u043d\u0430 \u0441\u043c\u0435\u043d\u0443 \u0440\u0435\u043a\u0440\u0443\u0442\u0441\u043a\u043e\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u0435 \u043f\u0440\u0438\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D1%8F%D0%B7%D0%B0%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D1%8C_%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0412\u043e\u0438\u043d\u0441\u043a\u0430\u044f \u043e\u0431\u044f\u0437\u0430\u043d\u043d\u043e\u0441\u0442\u044c \u0432 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0432\u0441\u0435\u043e\u0431\u0449\u0430\u044f \u0432\u043e\u0438\u043d\u0441\u043a\u0430\u044f \u043f\u043e\u0432\u0438\u043d\u043d\u043e\u0441\u0442\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898_%D0%B3%D0%BE%D0%B4\" title=\"1898 \u0433\u043e\u0434\">1898<\/a>&#160;\u2014 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D1%8F,_%D0%AD%D0%BC%D0%B8%D0%BB%D1%8C\" title=\"\u0417\u043e\u043b\u044f, \u042d\u043c\u0438\u043b\u044c\">\u042d\u043c\u0438\u043b\u044c \u0417\u043e\u043b\u044f<\/a> \u043f\u043e\u0441\u043b\u0430\u043b \u043e\u0442\u043a\u0440\u044b\u0442\u043e\u0435 \u043f\u0438\u0441\u044c\u043c\u043e (\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0435 \u043f\u043e\u0434 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF_%D0%BE%D0%B1%D0%B2%D0%B8%D0%BD%D1%8F%D1%8E_(%D1%81%D1%82%D0%B0%D1%82%D1%8C%D1%8F)\" title=\"\u042f \u043e\u0431\u0432\u0438\u043d\u044f\u044e (\u0441\u0442\u0430\u0442\u044c\u044f)\">\u00ab\u042f \u043e\u0431\u0432\u0438\u043d\u044f\u044e\u00bb<\/a>) \