4\" title=\"2009 \u0433\u043e\u0434\">2009<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0432\u0438\u044f\">\u041b\u0430\u0442\u0432\u0438\u0438<\/a> 27 \u043f\u0430\u0440\u0442\u0438\u0439 \u0438 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439 \u043f\u0440\u0438\u0437\u0432\u0430\u043b\u0438 \u0441\u0432\u043e\u0438\u0445 \u0441\u0442\u043e\u0440\u043e\u043d\u043d\u0438\u043a\u043e\u0432 \u043f\u0440\u0438\u0439\u0442\u0438 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80_(%D0%A0%D0%B8%D0%B3%D0%B0)\" title=\"\u0414\u043e\u043c\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440 (\u0420\u0438\u0433\u0430)\">\u0414\u043e\u043c\u0441\u043a\u0443\u044e \u043f\u043b\u043e\u0449\u0430\u0434\u044c<\/a> \u0438 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0430\u0442\u044c \u0438\u0434\u0435\u044e \u0440\u043e\u0441\u043f\u0443\u0441\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B9%D0%BC_%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D0%B8\" title=\"\u0421\u0435\u0439\u043c \u041b\u0430\u0442\u0432\u0438\u0438\">\u0421\u0435\u0439\u043c\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2012_%D0%B3%D0%BE%D0%B4\" title=\"2012 \u0433\u043e\u0434\">2012<\/a>&#160;\u2014 \u043a\u0440\u0443\u0438\u0437\u043d\u044b\u0439 \u043b\u0430\u0439\u043d\u0435\u0440 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Costa_Concordia\" class=\"mw-redirect\" title=\"Costa Concordia\">Costa Concordia<\/a>\u00bb, \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0438\u0441\u044c 4234 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%83%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BB%D0%B0%D0%B9%D0%BD%D0%B5%D1%80%D0%B0_%C2%ABCosta_Concordia%C2%BB\" class=\"mw-redirect\" title=\"\u041a\u0440\u0443\u0448\u0435\u043d\u0438\u0435 \u043b\u0430\u0439\u043d\u0435\u0440\u0430 \u00abCosta Concordia\u00bb\">\u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b \u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0435<\/a> \u0443 \u0431\u0435\u0440\u0435\u0433\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 30 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u0434\u0432\u043e\u0435 \u043f\u0440\u043e\u043f\u0430\u043b\u0438 \u0431\u0435\u0437 \u0432\u0435\u0441\u0442\u0438 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2015_%D0%B3%D0%BE%D0%B4\" title=\"2015 \u0433\u043e\u0434\">2015<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B1%D1%81%D1%82%D1%80%D0%B5%D0%BB_%D0%B0%D0%B2%D1%82%D0%BE%D0%B1%D1%83%D1%81%D0%B0_%D0%BF%D0%BE%D0%B4_%D0%92%D0%BE%D0%BB%D0%BD%D0%BE%D0%B2%D0%B0%D1%85%D0%BE%D0%B9\" title=\"\u041e\u0431\u0441\u0442\u0440\u0435\u043b \u0430\u0432\u0442\u043e\u0431\u0443\u0441\u0430 \u043f\u043e\u0434 \u0412\u043e\u043b\u043d\u043e\u0432\u0430\u0445\u043e\u0439\">\u043e\u0431\u0441\u0442\u0440\u0435\u043b \u0430\u0432\u0442\u043e\u0431\u0443\u0441\u0430<\/a> \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%BD%D0%BE%D0%B2%D0%B0%D1%85%D0%B0\" title=\"\u0412\u043e\u043b\u043d\u043e\u0432\u0430\u0445\u0430\">\u0412\u043e\u043b\u043d\u043e\u0432\u0430\u0445\u043e\u0439<\/a> \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D1%91%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BD%D1%84%D0%BB%D0%B8%D0%BA%D1%82_%D0%BD%D0%B0_%D0%B2%D0%BE%D1%81%D1%82%D0%BE%D0%BA%D0%B5_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B\" title=\"\u0412\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u0439 \u043a\u043e\u043d\u0444\u043b\u0438\u043a\u0442 \u043d\u0430 \u0432\u043e\u0441\u0442\u043e\u043a\u0435 \u0423\u043a\u0440\u0430\u0438\u043d\u044b\">\u0432\u043e\u0439\u043d\u044b \u043d\u0430 \u0414\u043e\u043d\u0431\u0430\u0441\u0441\u0435<\/a>.<\/li><\/ul><h2>"}